import React from 'react';
import Calculate from './calculate';

class TableRow extends React.Component {

    constructor(props) {
        super(props);
        this.state = {type1: '0', type2: '0'}
    }

    handleChange(event) {
        this.setState({
            ...this.state,
            [event.target.name]: event.target.value
        });
    }

    render() {
        return (
                    <tr>
                    <td className="text-dark d-flex">
                        <select className="form-select" aria-label=".form-select-sm example">
                            {this.props.options.map((type, index) => (
                                <option key={index} value={index}>{type.type}</option>
                            ))}
                        </select>
                        <select className="form-select" aria-label=".form-select-sm example">
                            {this.props.options.map((type, index) => (
                                <option key={index} value={index}>{type.type}</option>
                            ))}
                        </select>
                    </td>
                    <td>Ground, Water, Grass</td>
                    <td>Fire, Ghost</td>
                    </tr>
        );
    }
};

export default TableRow;
